import React from 'react';
import '.'

const Wpcardio = () => {
  return (
    <div className="slider-container">
      <nav className="slider-navbar">
        <ul className="navbar-list">
          <li className="navbar-item"><a href="#">Home</a></li>
          <li className="navbar-item"><a href="#">About</a></li>
          <li className="navbar-item"><a href="#">Services</a></li>
          <li className="navbar-item"><a href="#">Portfolio</a></li>
          <li className="navbar-item"><a href="#">Contact</a></li>
          <li className="navbar-item"><a href="#">Blog</a></li>
          <li className="navbar-item"><a href="#">Gallery</a></li>
          <li className="navbar-item"><a href="#">Team</a></li>
          <li className="navbar-item"><a href="#">FAQ</a></li>
          <li className="navbar-item"><a href="#">Support</a></li>
        </ul>
      </nav>
    </div>
  );
};

export default Wpcardio
